import UserDataService from "../services/user.service";
import { Link, useHistory } from "react-router-dom";
import "./maze.css"

export default class UsersList extends Component {
  constructor(props) {
    super(props);
    
    this.state = {
    };
  }

  render() {
    const history = useHistory();
    const routeChange = () =>{
      let path = '/Prob1';
      history.push(path)
    }
    return (
      <div>
        <div>
          <button className="btn" onClick={routeChange}> 이동 </button>
        </div>
      </div>
    );
  }
}
